.el-select-dropdown__item {
  color: #000;
  font-size: 12px;
}

.income-search {
  display: flex;
  box-shadow: 0 0 6px 0 rgba(0, 0, 0, .1);
  padding: 8px 20px;
  margin: 10px 5px;
  border-radius: 4px;
  .search-item >>> .el-input__inner {
    height 26px;
    font-size: 12px;
    padding: 0 10px;
  }
  .search-item {
    display: flex;
    align-items center;
    margin-right: 26px;
    width: 18%;
    .label {
      font-size: 12px;
      padding-right: 4px;
      color: #333;
      font-weight: 400;
      width 40%;
    }
    .search-btn {
      width: 30%;
      background: #009CFF;
      border: 1px solid #f5f5f5;
      text-align: center;
      border-radius: 4px;
      font-size: 12px;
      padding: 5px 1px;
      color: #fff;
      &:hover {
        cursor: pointer;
      }
    }
  }

  .search-item >>> .el-input__icon {
    line-height 26px;
  }
  .search-item >>> .el-input__prefix {
    display none;
  }

}

.income-form {
  margin: 20px 5px;
  box-shadow: 0 0 6px 0 rgba(0, 0, 0, .1);
  padding: 14px 20px;
  border-radius: 4px;

  .income-table {
    margin: 0 0 20px;
  }
  .table-summary {
    display: flex;
    margin: auto;
    padding: 20px 32%;
    border-bottom: 1px solid #F5F5F5;
    .order-sum, .order-money {
      width: 50%;
      text-align center;
      span {
        &:first-child {
          font-size: 12px;
          color: #333;
        }
        &:last-child {
          font-weight: 500;
          color: #CC0000;
        }
      }
    }
  }
}

.income-pagination {
  text-align center;
  margin: 20px 0;
}
